INSERT INTO `tbl_about` (`id`, `fill`, `type`) VALUES
(1, '<p>\r\n	&nbsp;</p>\r\n<p class="p1">\r\n	<span style="font-family:gotham rounded book;">Founded in 1979, Melissa is recognized in Brazil and around the world for its curatorial work in fashion, art and design, in addition to the innovative development of its key raw material: plastic. Back in the 80&rsquo;s, they signed their first international partnership agreement with renowned fashion designer Jean Paul Gaultier, then raising the banner of affordable luxury and democratization of design.</span></p>\r\n<p class="p1">\r\n	<span style="font-family:gotham rounded book;">Since then, more than 20 partnership agreements with illustrious names in fashion, design, music and celebrities were signed. In the beginning, it was not only Jean Paul Gaultier. Thierry Mugler and Patrick Cox also created head-turning pieces because of their innovation and boldness. 2004 was the beginning of the lasting and successful partnership with the renowned Campana Brothers.&nbsp;</span></p>\r\n<p class="p1">\r\n	<span style="font-family:gotham rounded book;">Designers J. <span class="GRnoSuggestion GRcorrect" grcontextid="Maskrey:0" grmarkguid="33a4c526-75c5-4ac8-9adf-d601d55dc3cd" gruiphraseguid="14300b52-3832-480a-b3fe-50e62ad2066b" style="">Maskrey</span>, an English lady renowned for her work with crystals, and Karim Rashid, an Egyptian man, known as the &ldquo;Prince of Plastic&rdquo;, were the next ones to sign their Melissas. In 2008, two extraordinary women joined the list: the British fashion designer Vivienne Westwood and Iraqi architect Zaha Hadid.</span></p>\r\n<p class="p1">\r\n	<span style="font-family:gotham rounded book;">In recent years, Melissa has continued to surprise their fans with partnerships such as with the talented Gareth Pugh, from London, and with the charismatic Jason Wu, from Taipei, two strong names of the new generation of couture designers. More recently, the beautiful Alessandra Ambr&oacute;sio and the redhead Julia Petit have also customized brand models, beside Brazilian fashion designer Pedro Louren&ccedil;o and the traditional English stamping brand Liberty Art Fabrics.&nbsp;</span></p>\r\n<p class="p1">\r\n	<span style="font-family:gotham rounded book;">The aim of the brand is to go for what&rsquo;s new, launching and <span class="GRcorrect" grcontextid="recreating:0" grmarkguid="334e940c-c2c3-4484-a7c9-36b1a9d099f4" gruiphraseguid="28d8ca17-9c40-456b-b874-5706024f2d60" style="">recreating</span> trends, and the outcome of that work is already recognized in the four corners of the world! Proving this, in 2009, Melissa had two models mentioned in the book &ldquo;Fifty Shoes That Changed the World&rdquo;, produced by the Design Museum London. Melissa Lady Dragon + Vivienne Westwood and Melissa + Zaha Hadid were those elected by the publication.</span></p>\r\n', 'description'),
(2, '<p>\r\n	Lorem ipsum dolor sit amet, consectetuer adipiscing elit, sed diam nonummy nibh euismod tincidunt ut laoreet dolore magna aliquam erat volutpat. Ut wisi enim ad minim veniam, quis nostrud exerci tation ullamcorper suscipit lobortis nisl ut aliquip ex ea commodo consequat. asd</p>\r\n<p>\r\n	<img alt="" src="http://localhost/antikode/bionicfarm/upload/images/sample_recipe.jpg" /></p>\r\n<p>\r\n	Lorem ipsum dolor sit amet, consectetuer adipiscing elit, sed diam nonummy nibh euismod tincidunt ut laoreet dolore magna aliquam erat volutpat. Ut wisi enim ad minim veniam, quis nostrud exerci tation ullamcorper suscipit lobortis nisl ut aliquip ex ea commodo consequat.</p>\r\n', 'about'),
(4, '<p>\r\n	Lorem ipsum dolor sit amet, consectetuer adipiscing elit, sed diam nonummy nibh euismod tincidunt ut laoreet dolore magna aliquam erat volutpat. Ut wisi enim ad minim veniam, quis nostrud exerci tation ullamcorper suscipit lobortis nisl ut aliquip ex ea commodo consequat.</p>\r\n<p>\r\n	Product Facilities</p>\r\n<p>\r\n	<img alt="" src="http://localhost/antikode/github/bionicorganic/upload/images/promo-1.jpg" /></p>\r\n', 'facilities'),
