(1, '5', 'natural resources becomes threaten', '23 November 2013', 'files/uploads/news_image/news_image-sample_recipe.jpg', 'Bionic Farm didirikan pada tahun 1990 dan berkomitmen untuk melestarikan alam dengan pertanian organik. Pada awalnya, Bionic Farm khusus membudidayakan jamur. Namun menyadari tumbuhnya kesadaran dan kepedulian masyarakat akan makanan yang dikonsumsi, Bionic Farm mengembangkan variasi produk pertanian organiknya.\r\n\r\nBionic Farm memiliki 2 lokasi pertanian yang utama, berada di Cibodas-Puncak dan Ciherang-Bogor, Jawa Barat. Di Cibodas, kami membudidayakan berbagai jenis jamur dataran tinggi, kopi, sayuran dan tanaman herbal. Di Ciherang, kami membudidayakan beras organik, Rosella serta berbagai jenis sayuran dan buah-buahan.', '2013-08-23', 'yes'),
(2, '3', 'natural bohemian', '23 Januari 2013', 'files/uploads/news_image/news_image-promo-1.jpg', 'Lorem ipsum dolor sit amet', '2013-08-23', 'yes'),
