(1, 1, 'FRUIT01', 'Jackfruit', 30000, 10, 'Naturally great tasting and nutritious Bionic Fruit Crisps. Made using only fresh and ripe organic fruits to retain their natural taste and goodness for your total enjoyment!\r\n\r\nBionic Farm produces 3 types : Jackfruit, Salak, Rambutan\r\n\r\nVacuum Fried, No Preservatives, No Colorants, No Trans-Fat', 0.08, 0, '../files/uploads/color_image/no-color.png', 0, 0, 1, 0, '', 'Fruits Crisps', ''),
(2, 1, 'FRUIT02', 'Salak', 30000, 10, 'Naturally great tasting and nutritious Bionic Fruit Crisps. Made using only fresh and ripe organic fruits to retain their natural taste and goodness for your total enjoyment!\r\n\r\nBionic Farm produces 3 types : Jackfruit, Salak, Rambutan\r\n\r\nVacuum Fried, No Preservatives, No Colorants, No Trans-Fat', 0.08, 0, '../files/uploads/color_image/no-color.png', 0, 0, 1, 0, '', 'Fruits Crisps', ''),
(3, 1, 'FRUIT03', 'Rambutan', 32100, 10, 'Naturally great tasting and nutritious Bionic Fruit Crisps. Made using only fresh and ripe organic fruits to retain their natural taste and goodness for your total enjoyment!\r\n\r\nBionic Farm produces 3 types : Jackfruit, Salak, Rambutan\r\n\r\nVacuum Fried, No Preservatives, No Colorants, No Trans-Fat', 0.08, 0, '../files/uploads/color_image/no-color.png', 0, 0, 1, 0, '', 'Fruits Crisps', ''),
