(49, 17, 'SHIITAKE1', 'Super', 30000, 10, 'Shiitake is considered to be Asia finest edible mushroom and one of the most widely cultivated specialty mushrooms in the world.\r\n\r\nShiitake is prized for its culinary delight and medicinal values. This particular mushroom contains eight essential amino acids, minerals, vitamins such as vitamins A, B, B12, C, D and niacin.\r\n\r\nHealth benefits :\r\n\r\nAnti cancer, contain lentinan\r\nReduce cholesterol levels, contain eritadenine\r\nReduce high blood pressure\r\nEnhance immune system\r\nRich in antioxidants, contain ergothioneine\r\nAnti viral\r\nProtection against thrombosis, contain lenthionine\r\nShiitake is suitable for most dishes and add meaty sensation when cooked.\r\n\r\nBionic Farm cultivates 2 variations : Shiitake Super and Shiitake Baby.', 0.1, 0, '../files/uploads/color_image/no-color.png', 0, 0, 1, 0, '', 'Shiitake', ''),
(50, 17, 'SHIITAKE2', 'Baby', 30000, 10, 'Shiitake is considered to be Asia finest edible mushroom and one of the most widely cultivated specialty mushrooms in the world.\r\n\r\nShiitake is prized for its culinary delight and medicinal values. This particular mushroom contains eight essential amino acids, minerals, vitamins such as vitamins A, B, B12, C, D and niacin.\r\n\r\nHealth benefits :\r\n\r\nAnti cancer, contain lentinan\r\nReduce cholesterol levels, contain eritadenine\r\nReduce high blood pressure\r\nEnhance immune system\r\nRich in antioxidants, contain ergothioneine\r\nAnti viral\r\nProtection against thrombosis, contain lenthionine\r\nShiitake is suitable for most dishes and add meaty sensation when cooked.\r\n\r\nBionic Farm cultivates 2 variations : Shiitake Super and Shiitake Baby.', 0.1, 0, '../files/uploads/color_image/no-color.png', 0, 0, 1, 0, '', 'Shiitake', ''),
