INSERT INTO `tbl_recipes` (`recipe_id`, `category_recipes`, `recipe_name`, `recipe_image`, `recipe_date`, `recipe_ingredients`, `recipe_sauce`, `method`, `alias`, `visibility_status`, `additional`) VALUES
(13, 21, 'Beef in oyster sauce', 'files/uploads/recipes_image/recipes_image-oyster.jpg', '2013-06-12', '350g/12oz beef fillet\r\n1 tsp light soy sauce\r\n1Â½ tbsp oyster sauce\r\npinch sugar\r\nsalt and freshly ground black pepper\r\n2 tbsp groundnut oil\r\n3 cloves garlic, finely chopped\r\n1 chilli, de-seeded, finely chopped\r\n200g/7oz baby spinach leaves\r\n1 tbsp Shaoxing rice wine or dry sherry\r\npinch dried chilli flakes', '1 tsp groundnut oil\r\n100g/3Â½oz oyster mushrooms\r\ndash Chinese black rice vinegar or balsamic vinegar\r\ndash light soy sauce', 'For the beef, place the fillet in between two sheets of cling film and bash with a meat mallet or rolling pin until half as thin. Slice the beef into thin pieces and place into a bowl, then season with the light soy sauce, oyster sauce, sugar and salt and freshly ground black pepper. Set aside.\r\nHeat a wok until smoking and add one tablespoon of the groundnut oil, then add the garlic and chilli. Stir-fry for a few seconds, then add the spinach leaves and toss for a few seconds, until warmed through. Pile onto a large serving plate.\r\nPlace the wok back on the heat and add the remaining oil, then add the beef slices and stir fry for 2-3 minutes, or until the beef is cooked to your liking. Pour in the Shaoxing rice wine and sprinkle over the dried chilli flakes. Pile the beef over the spinach leaves.\r\nFor the oyster mushrooms, heat the oil in the wok and add the oyster mushrooms, stir frying for one minute. Add a small splash of water to create some steam to help the mushrooms cook, then season, to taste, with the black rice vinegar and light soy sauce.\r\nSpoon the oyster mushrooms over the beef and serve.', 'beef-in-oyster-sauce', 'Visible', 'top'),
(12, 10, 'Creamy Mushroom Meatloaf', 'files/uploads/recipes_image/recipes_image-shiitake.jpg', '2013-06-26', '1/4 cup butter\r\n 2 cups shiitake mushrooms, sliced\r\n 1 pinch salt\r\n 1 sprig fresh rosemary, chopped\r\n 3 tablespoons all-purpose flour\r\n 2 1/2 cups beef broth\r\n salt and pepper to taste\r\n 1/2 cup heavy cream\r\n 1 (2 1/2 pound) uncooked prepared beef, veal and pork meatloaf', '', 'Preheat the oven to 325 degrees F (165 degrees C).\r\nMelt butter in an oven-safe skillet over medium-high heat. Stir in mushrooms and a pinch of salt; cook and stir until mushrooms begin to brown, about 5 minutes.\r\nStir in fresh rosemary. Add flour and stir to coat the mushrooms; cook and stir for about 3 minutes.\r\nWhisk in beef broth, 1/2 cup at a time, whisking constantly to prevent lumps.\r\nTurn heat to high and bring the sauce to a simmer. Simmer a few minutes until sauce starts to thicken. Season with salt and pepper to taste.\r\nRemove from heat and stir in heavy cream.\r\nSlide prepared meatloaf into the sauce. Spoon sauce over the top of the meatloaf.\r\nBake in the preheated oven until no longer pink in the center, about 1 1/2 hours. An instant-read thermometer inserted into the center should read at least 160 degrees F (70 degrees C).\r\nRemove pan from the oven and gently remove meatloaf to a serving platter.\r\nSkim off any extra fat from the surface of the sauce.\r\nBring the sauce to a boil over medium-high heat to reduce until thick, about 5 minutes.', 'creamy-mushroom-meatloaf', 'Visible', 'top');
